import "./animations.css";

export default function Contact() {
  return (
    <footer className="bg-dark text-light text-center py-5 fade-in">
      <h2>Contact</h2>
      <p>Email: tesfalem@example.com</p>
      <p>GitHub: github.com/tesfalem</p>
    </footer>
  );
}
